const Post = (props) =>{
    console.log(props.post)

    return(
        <div>
            <hr/>
            <h3>{props.post.username}</h3>
            <p>{props.post.content}</p>
            <p><b>Likes:</b> {props.post.likes}</p>
            {props.post.liked ? <button> Unlike </button> : <button> Like </button>}
          
            
            <hr/>
        </div>
    )
}
export default Post;
